<!DOCTYPE html>
<html lang="en">
<head>
    <link rel="stylesheet" type="text/css" href="./index.css"/>
    <meta charset="UTF-8">
    <title>Annotating Wireframes</title>
</head>
<body>
<div class="root">
    <div class="left_container border root_box">
        <div class="header padding5">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle">1</div>
        </div>
        <div class="main">
            <div class="main_left_section padding5">
                <div class="box_grey"></div>
                <div class="box_grey "></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="circle">2</div>
            </div>
            <div class="main_right_section">
                <div class="right_section_header padding5">
                    <div class="box_grey"></div>
                    <div class="circle">3</div>
                </div>
                <div class="right_section_block padding5">
                    <div class="box_grey"></div>
                    <div class="box_grey"></div>
                    <div class="box_grey"></div>
                    <div class="box_grey"></div>
                    <div class="circle">4</div>
                </div>
                <div class="right_section_main">
                    <div class="right_section_main_left padding5">
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="footer_box"></div>
                        <div class="circle">5</div>
                    </div>
                    <div class="right_section_main_right padding5">
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="box_grey"></div>
                        <div class="circle">6</div>
                    </div>
                </div>
                <div class="right_section_footer padding5">
                    <div class="box_grey"></div>
                    <div class="box_grey"></div>
                    <div class="circle ">7</div>
                </div>
            </div>
        </div>
    </div>

    <div class="center_container border root_box">
        <div class="center_header header padding5">
            <div id="center_box_one" class="box_grey"></div>
            <div id="center_box_two" class="box_grey"></div>
            <div class="circle">1</div>
            <div class="center_container_left_block padding5">
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="circle">2</div>
            </div>
        </div>
        <div class="block section_1 padding5">
            <div class="box_grey"></div>
            <div class="circle">3</div>
        </div>
        <div class="block section_2 padding5 ">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle">4</div>
        </div>
        <div class="block section_3 padding5">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="footer_box"></div>
            <div class="circle">5</div>
        </div>
        <div class="section_4 block padding5">
            <div class="section_4_left">
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
            </div>
            <div class="section_4_right"></div>
            <div class="circle ">6</div>
        </div>
        <div class="footer block padding5">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle ">7</div>
        </div>
    </div>

    <div class="right_container border root_box">
        <div class="header padding5">
            <div id="right_container_header_box_one" class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle">1</div>
            <div class="center_container_left_block padding5">
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="circle">2</div>
            </div>
        </div>
        <div class="block section_1 padding5">
            <div class="box_grey"></div>
            <div class="circle">3</div>
        </div>
        <div class="block section_2 padding5 ">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle">4</div>
        </div>
        <div class="right_container_section_3 block section_3 padding5">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="footer_box"></div>
            <div class="circle">5</div>
        </div>
        <div class="right_container_section_4 section_4 block padding5">
            <div class="right_container_section_header section_4_left">
                <div class="box_grey"></div>
                <div class="box_grey"></div>
                <div class="box_grey"></div>
            </div>
            <div class="right_container_section_footer section_4_right"></div>
            <div class="circle ">6</div>
        </div>
        <div class="footer block padding5">
            <div class="box_grey"></div>
            <div class="box_grey"></div>
            <div class="circle ">7</div>
        </div>
    </div>
</div>
</body>
</html>
